import './CSS/App.css';
import buildings from './data.js';
import Table from './components/Table.js';
import Chart from './components/Chart.js';
import Slider from './components/ImageSlider.js';
import { useState } from 'react';

import img1 from '../images/1.jpg';
import img2 from '../images/tower2.jpg';
import img3 from '../images/tower3.jpg';

function App() {
  const [filteredData, setFilteredData] = useState(buildings);

  const pics = [
   './images/1.png',
   './images/2.png',
   'images/3.png',
   'images/4.png',
   'images/5.png',
 ];




  return (
    <div className="App">
      <h3 className='title'>Самые высокие здания и сооружения</h3>
      <Chart data={filteredData} />
      <Table 
        data={buildings} 
        amountRows="15" 
        onFilter={setFilteredData}
      />
      <Slider images={pics} visibleCount={2} />;
    </div>
  );
}

export default App;
